So it was fitting that our mothership, which shares her name, helped Richard and our #Unity22 crew on their way to space, and will also carry the next generation of dreamers to release altitude on their spaceflights too.

“You were always my guiding light at Virgin Galactic. You shared with me that the day we named our mothership VMS Eve was one of your happiest. You always knew Eve would start my journey to space one day, just as I always knew you would do the impossible for me.”

@RichardBranson.

